import React from 'react';

const Divider = (props, selected) => {
  console.log(selected);
  let selectedD = '';
  if(props.selected !== undefined) {
    selectedD = props.selected;
    console.log(selectedD);
    selectedD = 'active';
  }
  return (
      <div className="divider {selectedD}" onClick={(e) => {
          e.stopPropagation();
          props.onDividerClick(props);
      }}>{props.divider}</div>
  );
}

export default Divider;
